import React, { useState } from "react";
import MainDashboardTop from "pages/Login/MainDashboardTop";

function HostelPages() {

    


  return (
    <div className="relative">
      <MainDashboardTop />
    <div className="md:flex">
       <div className="w-[100%] md:w-[50%]"> <img src="images/hostel1.jpeg" className="ml-[5%] w-[90%] md:w-[50%]"/></div>
       <div className="w-[50%] md:[25%]">
       <img src="images/hostel2.jpeg" className="w-[40%]  md:w-[100%]"/>
       <img src="images/hostel3.jpeg" className="w-[40%]  md:w-[100%]"/>
       </div>
       <div className="w-[50%] md:[25%]">
       <img src="images/hostel1.jpeg" className="w-[40%]  md:w-[100%]"/>
       <img src="images/hostel3.jpeg" className="w-[40%] md:w-[100%]"/>
       </div>
    </div>
    </div>
  );
}

export default HostelPages;
